import profileData from "../Data/profile.json"


const ProfileReducer= (state = profileData, action)=>{
  switch (action.type) {
    case 'save':
      //console.log(action.profile)
      state[0] = {
        ...state[0],
        ...action.profile[0],
      }
      return state;
    default:
      return state;
  }
};

export default ProfileReducer;
